DROP TABLE IF EXISTS cashman_bank_statements;

CREATE TABLE `cashman_bank_statements` (
  `ID` int(233) NOT NULL AUTO_INCREMENT,
  `bankId` int(11) DEFAULT NULL,
  `TransactionDate` date DEFAULT NULL,
  `Description` text NOT NULL,
  `Type` varchar(300) NOT NULL,
  `Category` int(233) NOT NULL,
  `MoneyOut` double NOT NULL,
  `MoneyIn` double NOT NULL,
  `Balance` double NOT NULL,
  `CheckBalance` double NOT NULL,
  `FileID` double NOT NULL,
  `AddedBy` int(233) NOT NULL,
  `compnayID` int(11) NOT NULL,
  `AddedOn` date DEFAULT NULL,
  `AccountantAccess` int(233) NOT NULL DEFAULT '0',
  `AssociatedWith` int(233) NOT NULL,
  `StatementType` varchar(300) NOT NULL,
  `Randomnumber` double NOT NULL,
  PRIMARY KEY (`ID`),
  KEY `FileID` (`FileID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



