  CONSTRAINT `cashman_banks_ibfk_1` FOREIGN KEY (`CompanyID`) REFERENCES `cashman_company` (`CID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS cashman_category_description;

