DROP TABLE IF EXISTS cashman_tax_rates;

CREATE TABLE `cashman_tax_rates` (
  `VID` int(23) NOT NULL AUTO_INCREMENT,
  `ClientID` int(23) NOT NULL,
  `CompanyID` int(11) NOT NULL,
  `Type` varchar(300) NOT NULL,
  `PercentRateAfterEndDate` varchar(300) NOT NULL,
  `StartDate` date NOT NULL,
  `EndDate` date NOT NULL,
  `PercentRate` double NOT NULL,
  `Status` int(23) NOT NULL,
  `AddedBy` int(23) NOT NULL,
  `AddedOn` date NOT NULL,
  `AccountantAccess` int(233) NOT NULL DEFAULT '0',
  PRIMARY KEY (`VID`),
  KEY `ClientID` (`ClientID`),
  CONSTRAINT `cashman_tax_rates_ibfk_3` FOREIGN KEY (`ClientID`) REFERENCES `cashman_users` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=latin1;

